<template>
  <div class="loadingBg"
       v-show='showBgLoading'>
    <div class="load_imgWrap">
      <div class="load_img"
           :style="`background-position-y: ${bgY}px;`"></div>
      <svg data-v-1c82800a=""
           xmlns="http://www.w3.org/2000/svg"
           version="1.1"
           class="load_ellipse">
        <ellipse data-v-1c82800a=""
                 cx="26"
                 cy="10"
                 rx="26"
                 ry="10"
                 style="fill: rgb(221, 221, 221); stroke: none;"></ellipse>
      </svg>
    </div>
  </div>
</template>
<script>
import {mapState} from 'vuex'
export default {
    data () {
        return {
            bgY: 0,
            timer: null
        }
    },
    computed: {
        ...mapState({
            showBgLoading: 'showBgLoading'
        })
    },
    watch: {
        showBgLoading (newV, oldV) {
            if (oldV && !newV) {
                clearInterval(this.timer)
            }
           console.log(newV, 'showBgLiading')
        } 
    },
    created () {
        this.setTimer()
    },
    methods: {
        setTimer () {
            this.timer = setInterval(() => {
                this.bgY -= 56
                if (this.bgY < -56*5) {
                    this.bgY = 0
                }
            }, 600)
        }
    }
}
</script>
<style lang="less">
@keyframes loadBg {
    0% {
        transform: translateY(0);
    }
    50% {
        transform: translateY(-60px);
    }
    100% {
        transform: translateY(0);
    }
}
@keyframes ellipse{
    0% {
        transform: scale(1);
    }
    50% {
        transform: scale(.3);
    }
    100% {
        transform: scale(1);
    }
}
  .loadingBg{
    position: fixed;
    top:0;
    left: 0;
    right: 0;
    bottom: 0;
    z-index: 100001;
    background: url('../assets/images/indexSvg.svg') no-repeat;
    background-size: 100%;
    .load_imgWrap{
        position: absolute;
        width: 67px;
